import React from "react";
import { View, Text } from "react-native";
import { Calendar } from "react-native-big-calendar";
var data = new Date(2022, 0, 6, 15, 45);
console.log(data);
var data2 = new Date(2022, 0, 6, 0, 0);
console.log(data2);
const events = [
  {
    title: "Encontro ok",
    start: new Date(2022, 1, 6, 10, 0),
    end: new Date(2022, 1, 7, 12, 0),
  },
  {
    title: "Coffee break",
    start: new Date(2022, 1, 7, 15, 45),
    end: new Date(2022, 1, 11, 16, 30),
  },
];
export default function CalendarioNovo() {
  return (
    <Calendar
      events={events}
      date={new Date(2022, 1, 6, 15, 45)}
      mode={"month"}
      height={600}
    />
  );
}
